// Original pine script by Alex Orekhov (everget)
let pLength = 22 // ATR length
let mult = 3    // ATR multiplier
let candle = record.current

// assign temp value
var atrMult = 0

// calculate atr
variable.lastHighs.push(candle.max)
variable.lastLows.push(candle.min)
variable.closes.push(candle.close)

variable.lastTR.push(calculateTR()) // Create the truerange array

if (variable.lastTR.length > pLength) {
    variable.lastTR.splice(0, 1)  // keep the array at size of pLength
    variable.lastHighs.splice(0, 1)
    variable.lastLows.splice(0, 1)
    variable.closes.splice(0, 1)

    //variable.AverageTrueRange = calculateATR(pLength)   // SMA version
    variable.AverageTrueRange = calculateATR_RMA(variable.lastTR.at(-1), variable.lastATR, pLength) // RMA version
    variable.lastATR = variable.AverageTrueRange

    atrMult = variable.AverageTrueRange * mult

    // long stop calcs
    variable.longStop = Math.max(...variable.closes) - atrMult
    variable.longStop = variable.prevClose > variable.longStopPrev ? Math.max(variable.longStop, variable.longStopPrev) : variable.longStop

    // short stop calcs
    variable.shortStop = Math.min(...variable.closes) + atrMult
    variable.shortStop = variable.prevClose < variable.shortStopPrev ? Math.min(variable.shortStop, variable.shortStopPrev) : variable.shortStop

    // direction calc
    variable.dir = 1
    variable.dir = candle.close > variable.shortStopPrev ? 1 : candle.close < variable.longStopPrev ? -1 : 0 // 0 was variable.dir in pine script

    variable.dir = variable.dir == 0 ? variable.prevDir : variable.dir  // condition to catch previous line not continuing the correct trend

    if (variable.dir == 1 && variable.prevDir == -1) {
        variable.buySignal = 1
    } else { variable.buySignal = 0 }

    if (variable.dir == -1 && variable.prevDir == 1) {
        variable.sellSignal = 1
    } else { variable.sellSignal = 0 }

}

variable.atrMult = atrMult

// mid price point calc
variable.midPricePlot = (candle.max + candle.open + candle.close + candle.min) / 4

// keep track of previous values
variable.prevClose = candle.close
variable.longStopPrev = variable.longStop
variable.shortStopPrev = variable.shortStop
variable.prevDir = variable.dir

